import { useDispatch, useSelector } from "react-redux"
import { Addprod } from "./actios/acionprodact";

export default function Prodact(){
    const prodact=useSelector(state=>state.prodact);
    const dispatch=useDispatch()
    return(
        <div>
            <button onClick={()=>dispatch(Addprod({id:1,title:"ABDULLAH"}))}>Add Pordact</button>
         {prodact.map((pro)=>(<h2 key={pro.id}>{pro.title}</h2>))}
              
          
        </div>
    )
}
